label("<fact5>3 cm</fact5>",(10,1.5),E);
draw((0,2.5)--(.5,2.5)--(.5,3));
draw((10,2.5)--(9.5,2.5)--(9.5,3));
[/asy]
I want you to answer this question but your explanation should contain references referring back to the information in the question.

Answer: 
The <fact1>shaded triangle</fact1> is half of a <fact6>rectangle</fact6> with side lengths <fact2>10 cm</fact2> and <fact4>3 cm</fact4>, so the area of the <fact1>shaded triangle</fact1> is half of the area of the <fact6>rectangle</fact6>. The area of the <fact6>rectangle</fact6> is <fact2>10 cm</fact2> times <fact4>3 cm</fact4>, or <fact7>30 square centimeters</fact7>. Half of <fact7>30 square centimeters</fact7> is <fact8>15 square centimeters</fact8>. Therefore, the area of the <fact1>shaded triangle</fact1> is <fact8>15 square centimeters</fact8>.

question:
In the diagram, $D$ and $E$ are the midpoints of $\overline{AB}$ and $\overline{BC}$ respectively.  Determine the area of quadrilateral $DBEF$. [asy]
size(180); defaultpen(linewidth(.7pt)+fontsize(10pt));
pair A, B, C, D, E, F;
A=(0,6);
B=(0,0);
C=(8,0);
D=(0,3);
E=(4,0);
F=(8/3,2);
draw(E--A--C--D);
draw((-1,0)--(10,0), EndArrow);
draw((0,-1)--(0,8), EndArrow);
label("$A(0,6)$", A, W);
label("$B(0,0)$", B, SW);
label("$C(8,0)$", C, S);
label("$D$", D, W);
label("$E$", E, S);
label("$F$", F, SW);
label("$x$", (10,0), dir(0));
label("$y$", (0,8), dir(90));
[/asy]

answer:
Formatted Question: 
In the diagram, <fact1>$D$</fact1> and <fact2>$E$</fact2> are the <fact3>midpoints</fact3> of <fact4>$\overline{AB}$</fact4> and <fact5>$\overline{BC}$</fact5> respectively.  Determine the <fact6>area</fact6> of quadrilateral <fact7>$DBEF$</fact7>. 

[asy]
size(180); defaultpen(linewidth(.7pt)+fontsize(10pt));
pair A, B, C, D, E, F;
A=(0,6);
B=(0,0);
C=(8,0);
D=(0,3);
E=(4,0);
F=(8/3,2);
draw(E--A--C--D);
draw((-1,0)--(10,0), EndArrow);
draw((0,-1)--(0,8), EndArrow);
label("$A(0,6)$", A, W);
label("$B(0,0)$", B, SW);
label("$C(8,0)$", C, S);
label("$D$", D, W);
label("$E$", E, S);
label("$F$", F, SW);
label("$x$", (10,0), dir(0));
label("$y$", (0,8), dir(90));
[/asy]

Answer: 
We have that $[DBEF]=[ABC]-[ADE].$ By using the formula for the area of a triangle, we can find that $[ABC]=\frac{1}{2}\cdot 8\cdot 6=24.$  Also, since $D$ and $E$ are the <fact3>midpoints</fact3> of $\overline{AB}$ and $\overline{BC}$, respectively, we have that $[ADE]=\frac{1}{2}\cdot 4\cdot 3=6.$ Therefore, the <fact6>area</fact6> of quadrilateral $DBEF$ is $24-6=\boxed{18}.$

question:
In quadrilateral $ABCD$, angle $BAD$ and angle $CDA$ are trisected as shown. What is the degree measure of angle $AFD$?

