answer:
Formatted Question: In quadrilateral $<fact1>ABCD</fact1>$, angle $<fact2>BAD</fact2>$ and angle $<fact3>CDA</fact3>$ are trisected as shown. What is the degree measure of angle $<fact4>AFD</fact4>$?

[asy]
size(150);
pair A , B, C, D; A = (0,0); B = (2, 4); C = (7,4); D = (7, -2);
draw( (0,0)--(2,4) -- (7,4) -- (7, -2)-- cycle);
