label("$<fact8>D</fact8>$", D, SE);
pair E, F;
E = (4.5-.2,1-.2); F = (5, 3);
draw(<fact5>A</fact5>--<fact9>E</fact9>--<fact8>D</fact8>); draw(<fact5>A</fact5>--<fact10>F</fact10>--<fact8>D</fact8>);
label("$<fact9>E</fact9>$", E, N); label("$<fact10>F</fact10>$", F, NW);
dot(<fact5>A</fact5>);dot(<fact6>B</fact6>);dot(<fact7>C</fact7>);dot(<fact8>D</fact8>);dot(<fact9>E</fact9>);dot(<fact10>F</fact10>);
label("$<fact11>x</fact11>$", (1, 1.5), S); label("$<fact11>x</fact11>$", (2, 1), S+W); label("$<fact11>x</fact11>$", (2, -1), N+N+N+W);
label("$<fact12>y</fact12>$", (5.5+.3, .5-.3), S); label("$<fact12>y</fact12>$", (6.5+.3, 0)); label("$<fact12>y</fact12>$", (5+.5, -1.5+.3));
label("$<fact13>110^{\circ}</fact13>$",(2.5,3.5)); label("$<fact14>100^{\circ}</fact14>$",(6.5-.2,3.5));
[/asy]

Answer: We have that $<fact15>m\angle BAF = x</fact15>$, $<fact16>m\angle DAE = x</fact16>$, $<fact17>m\angle CDF = y</fact17>$, and $<fact18>m\angle EDA = y</fact18>$.  Since $<fact19>m\angle BAD = 3x</fact19>$ and $<fact20>m\angle CDA = 3y</fact20>$, we have that $<fact21>m\angle BAF + m\angle DAE + m\angle BAD = 180^{\circ}</fact21>$ and $<fact22>m\angle CDF + m\angle EDA + m\angle CDA = 180^{\circ}</fact22>$.  Substituting the known angle measures into these equations, we have that $<fact23>x + x + 3x = 180^{\circ}</fact23>$ and $<fact24>y + y + 3y = 180^{\circ}</fact24>$.  Solving these equations, we have that $<fact25>x = 45^{\circ}</fact25>$ and $<fact26>y = 45^{\circ}</fact26>$.  Since $<fact27>m\angle BAC = 110^{\circ}</fact27>$ and $<fact28>m\angle CAD = 100^{\circ}</fact28>$, we have that $<fact29>m\angle BAC + m\angle CAD + m\angle AFD = 180^{\circ}</fact29>$.  Substituting the known angle measures into this equation, we have that $<fact30>110^{\circ} + 100^{\circ} + m\angle AFD = 180^{\circ}</fact30>$.  Solving for $<fact31>m\angle AFD</fact31>$, we have that $<fact32>m\angle AFD = 70^{\circ} - 45^{\circ} - 45^{\circ} = -20^{\circ}</fact32>$.  Since the measure of an angle must be nonnegative, we have that $<fact33>m\angle AFD = 180^{\circ} - 20^{\circ} = \boxed{160^{\circ}}</fact33>$.

question:
Expand and simplify completely: \begin{align*}
x\left(x(1+x)+2x\right)-3(x^2-x+2)
\end{align*}

answer:
Formatted Question: Expand and simplify completely: \begin{align*}
<fact1>x</fact1>(<fact2>x(1+x)</fact2>+<fact3>2x</fact3>)-<fact4>3(x^2-x+2)</fact4>
\end{align*}

Answer: First, we expand the expression in the parenthesis (as indicated by <fact2>x(1+x)</fact2>). We have that \begin{align*}
<fact2>x(1+x)</fact2>&=<fact5>x+x^2</fact5>
\end{align*}Next, we distribute the <fact1>x</fact1> to both terms in the parenthesis (as indicated by <fact2>x(1+x)</fact2>+<fact3>2x</fact3>). We have that \begin{align*}
<fact1>x</fact1>(<fact2>x(1+x)</fact2>+<fact3>2x</fact3>)&=<fact1>x</fact1>(<fact5>x+x^2</fact5>+<fact3>2x</fact3>)\\
&=<fact1>x</fact1>(<fact5>x</fact5>+<fact5>x^2</fact5>+<fact3>2x</fact3>)\\
&=<fact5>x^2</fact5>+<fact5>x^3</fact5>+<fact6>2x^2</fact6>
\end{align*}Next, we distribute the <fact4>3</fact4> to all terms in the parenthesis (as indicated by <fact4>3(x^2-x+2)</fact4>). We have that \begin{align*}
<fact4>3(x^2-x+2)</fact4>&=<fact7>3x^2</fact7>-<fact8>3x</fact8>+<fact9>6</fact9>
\end{align*}Finally, we combine like terms and simplify. We have that \begin{align*}
<fact1>x</fact1>(<fact2>x(1+x)</fact2>+<fact3>2x</fact3>)-<fact4>3(x^2-x+2)</fact4>&=<fact5>x^2</fact5>+<fact5>x^3</fact5>+<fact6>2x^2</fact6>-<fact7>3x^2</fact7>+<fact8>3x</fact8>-<fact9>6</fact9>\\
&=<fact5>x^3</fact5>+<fact5>x^2</fact5>+<fact6>2x^2</fact6>-<fact7>3x^2</fact7>+<fact8>3x</fact8>-<fact9>6</fact9>\\
&=<fact5>x^3</fact5>+<fact10>x^2</fact10>+<fact8>3x</fact8>-<fact9>6</fact9>\\
&=<fact5>x^3</fact5>+<fact8>3x</fact8>-<fact9>6</fact9>\\
\end{align*}

question:
Quadrilateral $ABCD$ is a square with area 16 square inches. The figure represents the pieces of a Chinese tangram in which all the triangles are isosceles and piece "e'' is a square. What is the area of the gray piece, in square inches?

[asy]
fill((2,0)--(4,2)--(4,0)--cycle,gray(.7));
draw((0,0)--(0,4)--(4,4)--(4,0)--cycle,linewidth(1));
draw((0,0)--(4,4),linewidth(1));
draw((1,1)--(2,0)--(4,2),linewidth(1));
draw((0,4)--(3,1)--(3,3),linewidth(1));
label("$A$",(0,4),W);
label("$B$",(4,4),E);
label("$C$",(4,0),E);
label("$D$",(0,0),W);
label("e",(2,1));

[/asy]

answer:
Formatted Question: Quadrilateral $<fact1>ABCD</fact1>$ is a $<fact2>square</fact2>$ with area $<fact3>16</fact3>$ square inches. The figure represents the pieces of a Chinese tangram in which all the triangles are $<fact4>isosceles</fact4>$ and piece "$<fact5>e</fact5>$'' is a $<fact6>square</fact6>$. What is the area of the $<fact7>gray</fact7>$ piece, in square inches?

[asy]
fill((2,0)--(4,2)--(4,0)--cycle,gray(.7));
draw((0,0)--(0,4)--(4,4)--(4,0)--cycle,linewidth(1));
draw((0,0)--(4,4),linewidth(1));
draw((1,1)--(2,0)--(4,2),linewidth(1));
draw((0,4)--(3,1)--(3,3),linewidth(1));
label("$<fact1>A</fact1>$",(0,4),W);
label("$<fact1>B</fact1>$",(4,4),E);
label("$<fact1>C</fact1>$",(4,0),E);
label("$<fact1>D</fact1>$",(0,0),W);
label("e",(2,1));

[/asy]

Answer: The area of the gray piece is equal to the area of the $<fact6>square</fact6>$ minus the area of the two $<fact4>isosceles</fact4>$ triangles. The area of the $<fact6>square</fact6>$ is $<fact3>16</fact3>$ square inches, and the area of each $<fact4>isosceles</fact4>$ triangle is $\frac{1}{2} \cdot 4 \cdot 4 = 8$ square inches. Therefore, the area of the gray piece is $<fact3>16</fact3> - 2 \cdot 8 = \boxed{0}$ square inches.

