question:
A square and an equilateral triangle have	equal	perimeters.	The area of the triangle is $16\sqrt{3}$ square centimeters. How long, in centimeters, is a diagonal of the square? Express your answer in simplest radical form.

[asy]
defaultpen(linewidth(1));
draw((0,0)--(1,0)--(1,1)--(0,1)--cycle);
pair a = (1.25,0)+1.25*dir(60);
pair b = a+1.25*dir(-60);
draw((1.25,0)--a--b--cycle);

[/asy]

answer:
Formatted Question: 
A <fact1>square</fact1> and an <fact2>equilateral triangle</fact2> have equal <fact3>perimeters</fact3>. The <fact4>area of the triangle</fact4> is $16\sqrt{3}$ square centimeters. How long, in centimeters, is a <fact5>diagonal of the square</fact5>? Express your answer in simplest radical form.

[asy]
defaultpen(linewidth(1));
draw((0,0)--(1,0)--(1,1)--(0,1)--cycle);
pair a = (1.25,0)+1.25*dir(60);
pair b = a+1.25*dir(-60);
draw((1.25,0)--a--b--cycle);

[/asy]

Answer: 
Let's denote the <fact6>side length of the square</fact6> as $s$ and the <fact7>side length of the equilateral triangle</fact7> as $t$. Since the <fact3>perimeters</fact3> of the square and the equilateral triangle are equal, we have $4s=3t$, which gives us $s=\frac{3}{4}t$.
Since the <fact4>area of the triangle</fact4> is $16\sqrt{3}$ square centimeters, we have $\frac{t^2\sqrt{3}}{4}=16\sqrt{3}$, which gives us $t^2=64$ and $t=8$.
Now, we can find the <fact6>side length of the square</fact6> using $s=\frac{3}{4}t$, which gives us $s=\frac{3}{4}\cdot8=6$.
Finally, we can find the <fact5>diagonal of the square</fact5> using the Pythagorean theorem, which gives us $\sqrt{6^2+6^2}=\sqrt{72}=6\sqrt{2}$ centimeters.

Formatted Question: In a <fact1>class of 50 students</fact1>, <fact2>28 participate in MATHCOUNTS</fact2>, <fact3>21 participate in science club</fact3>, and <fact4>6 students participate in neither</fact4>. How many students participate in both <fact5>MATHCOUNTS</fact5> and <fact6>science club</fact6>?

Answer: Let $x$ be the number of students participating in both MATHCOUNTS and science club.  Then, the number of students participating in MATHCOUNTS only is $28-x$ and the number of students participating in science club only is $21-x$.  Since there are $50$ students total and $6$ participate in neither, the number of students participating in either MATHCOUNTS or science club is $50-6=44$.  We can now write the equation \begin{align*}
(28-x)+(21-x)+x&=44\\
\Rightarrow\qquad 49-x&=44\\
\Rightarrow\qquad x&=\boxed{5}
\end{align*}

