answer:
Formatted Question: What is the shortest distance from the point $(6, 0)$ to the line $y = 2x-2$? Express your answer in simplest radical form.

Answer: The shortest distance from a point $(x_0,y_0)$ to the line $Ax+By+C=0$ is $$\frac{|Ax_0+By_0+C|}{\sqrt{A^2+B^2}}.$$For the point $(6,0)$ and the line $y=2x-2$, we have $A=2$, $B=-1$, $C=-2$, $x_0=6$, and $y_0=0$. Therefore, the shortest distance is \begin{align*}
\frac{|2\cdot6-1\cdot0-2|}{\sqrt{2^2+(-1)^2}}&=\frac{10}{\sqrt{5}}\\
&=\frac{10}{\sqrt{5}}\cdot\frac{\sqrt{5}}{\sqrt{5}}\\
&=\boxed{2\sqrt{5}}
\end{align*}

