answer:
Formatted Question: In $\triangle{<fact1>RST</fact1>}$, shown, $\sin{<fact2>R</fact2>}=\frac{<fact3>2</fact3>}{<fact4>5</fact4>}$.  What is $\sin{<fact5>T</fact5>}$?

[asy]
pair <fact6>R</fact6>,<fact7>S</fact7>,<fact8>T</fact8>;
<fact8>T</fact8> = (0,0);
<fact7>S</fact7> = (2,0);
<fact6>R</fact6> = (2,sqrt(21));
draw(<fact6>R</fact6>--<fact7>S</fact7>--<fact8>T</fact8>--<fact6>R</fact6>);
draw(rightanglemark(<fact6>R</fact6>,<fact7>S</fact7>,<fact8>T</fact8>,10));
label("$<fact8>T</fact8>$",<fact8>T</fact8>,SW);
label("$<fact7>S</fact7>$",<fact7>S</fact7>,SE);
label("$<fact6>R</fact6>$",<fact6>R</fact6>,NE);
label("$<fact9>5</fact9>$",(R+T)/2,NW);
[/asy]

Answer: We have that $\sin{<fact2>R</fact2>}=\frac{<fact3>2</fact3>}{<fact4>5</fact4>}$, so $\cos{<fact2>R</fact2>}=\sqrt{1-\sin^2{<fact2>R</fact2>}}=\frac{\sqrt{21}}{<fact4>5</fact4>}$, and thus $\tan{<fact2>R</fact2>}=\frac{\sin{<fact2>R</fact2>}}{\cos{<fact2>R</fact2>}}=\frac{<fact3>2</fact3>}{\sqrt{21}}$.  Since $\tan\theta=\frac{\text{opposite}}{\text{adjacent}}$ in a right triangle, we have that $\tan{<fact2>R</fact2>}=\frac{<fact7>S</fact7><fact6>R</fact6>}{<fact6>R</fact6><fact8>T</fact8>}$, so $\frac{<fact3>2</fact3>}{\sqrt{21}}=\frac{<fact7>S</fact7><fact6>R</fact6>}{<fact6>R</fact6><fact8>T</fact8>}$, and thus $<fact7>S</fact7><fact6>R</fact6>=\frac{<fact3>2</fact3>}{\sqrt{21}}\cdot<fact6>R</fact6><fact8>T</fact8>=\frac{<fact3>2</fact3>}{\sqrt{21}}\cdot<fact9>5</fact9>=\frac{<fact10>10</fact10>}{\sqrt{21}}$.  Therefore, $\sin{<fact5>T</fact5>}=\frac{<fact7>S</fact7><fact6>R</fact6>}{<fact7>S</fact7><fact8>T</fact8>}=\frac{\frac{<fact10>10</fact10>}{\sqrt{21}}}{\sqrt{\left(\frac{<fact10>10</fact10>}{\sqrt{21}}\right)^2+<fact9>5</fact9>^2}}=\frac{\frac{<fact10>10</fact10>}{\sqrt{21}}}{\sqrt{\frac{<fact11>100</fact11>}{21}+<fact9>5</fact9>^2}}=\frac{\frac{<fact10>10</fact10>}{\sqrt{21}}}{\sqrt{\frac{<fact11>100</fact11>+<fact12>525</fact12>}{21}}}=\frac{\frac{<fact10>10</fact10>}{\sqrt{21}}}{\sqrt{\frac{<fact13>625</fact13>}{21}}}=\frac{\frac{<fact10>10</fact10>}{\sqrt{21}}}{\frac{\sqrt{<fact13>625</fact13>}}{\sqrt{21}}}=\frac{\frac{<fact10>10</fact10>}{\sqrt{21}}}{\frac{<fact14>25</fact14>}{\sqrt{21}}}=\frac{<fact10>10</fact10>}{<fact14>25</fact14>}=\boxed{\frac{<fact10>2</fact10>}{<fact14>5</fact14>}}$.

