Answer: Let $x$ be the length of the two edges of the field that are not part of the semicircles, and let $y$ be the radius of the two semicircles.  Then the total length of the track is equal to $2x$ plus the circumference of the two semicircles, which is $2\pi y$.  Since the length of the track is <fact1>400</fact1> meters, we have $2x+2\pi y=400$, or equivalently, $x+\pi y=200$.  The area of the field is $xy$, so we want to maximize $xy$ subject to the constraint $x+\pi y=200$.  Using the method of Lagrange multipliers, we find that $x$ and $y$ must satisfy the system of equations \begin{align*}
y&=\lambda,\\
x&=\lambda\pi,\\
x+\pi y&=200.
\end{align*}Substituting the first equation into the second equation, we find that $x=\pi y$.  Substituting this into the third equation, we find that $\pi y+\pi y=200$, or $y=100/\pi$.  Therefore, $x=\pi y=100$, so the maximum possible area of the field is $xy=(100)(100/\pi)=\boxed{10000/\pi}$ square meters.
